17.body:
–î–ª—è —Ç–∞–∫–æ–π –≥—Ä—É–ø–ø–∏—Ä–æ–≤–∫–∏ –∏—Å–ø–æ–ª—å–∑—É–µ–º —Ç—Ä–µ–π—Ç .tag(...), –∫–æ—Ç–æ—Ä—ã–π —Ç—ã –≤—Å—Ç—Ä–µ—á–∞–ª —Ä–∞–Ω–µ–µ –≤ –∫–Ω–∏–≥–µ. –ï—Å–ª–∏ —Ç–µ–≥ –ø—Ä–∏–º–µ–Ω–µ–Ω –∫ —Ç–∏–ø—É –¥–∞–Ω–Ω—ã—Ö –≤ –º–∞–∫—Ä–æ—Å–µ @Suite, —Ç–æ –≤—Å–µ –º–µ—Ç–æ–¥—ã –±—É–¥—É—Ç —Å–≥—Ä—É–ø–ø–∏—Ä–æ–≤–∞–Ω–Ω—ã —Å–æ–æ—Ç–≤–µ—Ç—Å–≤—É—é—â–∏–º —Ç–µ–≥–æ–º. note –°–ª–µ–¥—É–µ—Ç –æ—Ç–º–µ–Ω–∏—Ç—å, —á—Ç–æ –ø—Ä–∏–º–µ–Ω–µ–Ω–∏–µ —Ç–µ–≥–æ–≤ –ø—Ä–æ–∏—Å—Ö–æ–¥–∏—Ç –≤ runtime. –°–∞–º–∏ –ø–æ —Å–µ–±–µ —Ç–µ–≥–∏ —è–≤–ª—è—é—Ç—Å—è —ç–∫–∑–µ–º–ø–ª—è—Ä–∞–º–∏ —Å—Ç—Ä—É–∫—Ç—É—Ä—ã Tag. –î–ª—è –¥–æ–±–∞–≤–ª–µ–Ω–∏—è —Å–æ–±—Å—Ç–≤–µ–Ω–Ω–æ–≥–æ —Ç–µ–≥–∞ –≤ –ø—Ä–æ–µ–∫—Ç –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ —Å–¥–µ–ª–∞—Ç—å —Ä–∞—Å—à–∏—Ä–µ–Ω–∏–µ –¥–∞–Ω–Ω–æ–π —Å—Ç—Ä—É–∫—Ç—É—Ä—ã: extension Tag { /// –í—Å–µ, —á—Ç–æ —Å–≤—è–∑–∞–Ω–æ —Å –∫–∞–ª—å–∫—É–ª—è—Ç–æ—Ä–æ–º @Tag static var calculator: Self
} –í —Ä–∞—Å—à–∏—Ä–µ–Ω–∏–∏ –º—ã –æ–±—ä—è–≤–ª—è–µ–º —Å—Ç–∞—Ç–∏—á–µ—Å–∫–æ–µ —Å–≤–æ–π—Å—Ç–≤–æ, —É–∫–∞–∑—ã–≤–∞—é—â–µ–µ –Ω–∞ —ç—Ç–æ—Ç –∂–µ —Ç–∏–ø –∏ –ø—Ä–∏–º–µ–Ω—è–µ—Ç –º–∞–∫—Ä–æ—Å @Tag. –°–∞–º –ø–æ —Å–µ–±–µ –º–∞–∫—Ä–æ—Å @Tag –Ω–µ –ø—Ä–∏–Ω–∏–º–∞–µ—Ç –Ω–∏–∫–∞–∫–∏—Ö –ø–∞—Ä–∞–º–µ—Ç—Ä–æ–≤. important –ë–∏–±–ª–∏–æ—Ç–µ–∫–∞ —Ç–µ—Å—Ç–∏—Ä–æ–≤–∞–Ω–∏—è –Ω–µ –ø—Ä–∏—Å–≤–∞–∏–≤–∞–µ—Ç –Ω–∏–∫–∞–∫–æ–≥–æ —Å–µ–º–∞–Ω—Ç–∏—á–µ—Å–∫–æ–≥–æ –∑–Ω–∞—á–µ–Ω–∏—è —Ç–µ–≥–∞–º. –ù–∞–ª–∏—á–∏–µ –∏–ª–∏ –æ—Ç—Å—É—Ç—Å—Ç–≤–∏–µ —Ç–µ–≥–æ–≤ –Ω–µ –≤–ª–∏—è–µ—Ç –Ω–∞ —Ç–æ, –∫–∞–∫ –±–∏–±–ª–∏–æ—Ç–µ–∫–∞ —Ç–µ—Å—Ç–∏—Ä–æ–≤–∞–Ω–∏—è –≤—ã–ø–æ–ª–Ω—è–µ—Ç —Ç–µ—Å—Ç—ã. –ò–Ω–æ–≥–¥–∞ –≤–æ–∑–Ω–∏–∫–∞–µ—Ç —Å–∏—Ç—É–∞—Ü–∏—è, –∫–æ–≥–¥–∞ –∏–º—è —Ç–µ–≥–∞ —É–∂–µ –∏—Å–ø–æ–ª—å–∑—É–µ—Ç—Å—è –≤ –¥—Ä—É–≥–æ–º —Ç–∞—Ä–≥–µ—Ç–µ –∏–ª–∏ —Ñ–∞–π–ª–∞. –í —Ç–∞–∫–æ–º —Å–ª—É—á–∞–µ —Ç—ã –º–æ–∂–µ—à—å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å reverse-DNS –∏–º–µ–Ω–æ–≤–∞–Ω–∏–µ –¥–ª—è —Å–æ–∑–¥–∞–Ω–∏—è —É–Ω–∏–∫–∞–ª—å–Ω–æ–≥–æ –∏–º–µ–Ω–∏: extension Tag { enum api_V3 {}
