19.body:
–ü–æ—Å–ª–µ –¥–æ–±–∞–≤–ª–µ–Ω–∏–µ —Ç–µ–≥–∞, –≤ –ø–∞–Ω–µ–ª–∏ –Ω–∞–≤–∏–≥–∞—Ü–∏–∏ –≤–∏–¥–µ–Ω –µ–≥–æ —Ü–≤–µ—Ç. Xcode –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª—è–µ—Ç —Ç–æ–ª—å–∫–æ –æ–¥–∏–Ω —Ü–≤–µ—Ç ‚Äî —Ñ–∏–æ–ª–µ—Ç–æ–≤—ã–π. –¶–≤–µ—Ç–∞ —Ç–µ–≥–æ–≤ –î–ª—è –≤—ã–≤–æ–¥–∞ –≤ —Ç–µ—Ä–º–∏–Ω–∞–ª–µ, –±–∏–±–ª–∏–æ—Ç–µ–∫–∞ —Ç–µ—Å—Ç–∏—Ä–æ–≤–∞–Ω–∏—è –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª—è–µ—Ç —Å–ª–µ–¥—É—é—â–∏–µ —Ü–≤–µ—Ç–∞ –¥–ª—è –∫–æ–º–∞–Ω–¥—ã swift test: –ö—Ä–∞—Å–Ω—ã–π –û—Ä–∞–Ω–∂–µ–≤—ã–π –ñ–µ–ª—Ç—ã–π –ó–µ–ª–µ–Ω—ã–π –°–∏–Ω–∏–π –§–∏–æ–ª–µ—Ç–æ–≤—ã–π –°—Ç–æ–∏—Ç —É–ø–æ–º–Ω—è—Ç—å –æ –∑–∞–±–∞–≤–Ω–æ–º —Ñ–∞–∫—Ç–µ –≤ –∏—Å—Ç–æ—Ä–∏–∏ Apple. –ò–Ω–∂–µ–Ω–µ—Ä—ã Apple –∏—Å–ø–æ–ª—å–∑—É—é—Ç —Ü–≤–µ—Ç–∞ –∏–∑ –æ—Ä–∏–≥–∏–Ω–∞–ª—å–Ω–æ–π –û–° System 7 (1991 –≥, –ø–æ–∑–∂–µ –Ω–∞–∑–≤–∞–ª–∏ Mac OS 7), –ø–æ—ç—Ç–æ–º—É –µ—Å–ª–∏ —Ç—ã —Å–¥–µ–ª–∞–ª —Ç–µ–≥ –æ–¥–Ω–∏–º –∏–∑ –∏–º–µ–Ω –Ω–∏–∂–µ, —Ç–æ –ø—Ä–∏ –≤—ã–∑–æ–≤–µ –∫–æ–º–∞–Ω–¥—ã swift test —Ü–≤–µ—Ç —Ç–µ–≥–∞ –∏–∑–º–µ–Ω–∏—Ç—Å—è. extension Tag { @Tag static var essential: Self
} @Test(.tags(.essential))
func showTestName() { #expect(Test.current?.displayName == nil)
} System 7 note –ò–∑–º–µ–Ω–µ–Ω–∏–µ —Ü–≤–µ—Ç–∞ —Ç–µ–≥–∞ –Ω–µ –∫–∞—Å–∞–µ—Ç—Å—è Xcode, –ø–æ—Å–∫–æ–ª—å–∫—É —ç—Ç–∞ —Ñ—É–Ω–∫—Ü–∏—è —ç–∫—Å–ø–µ—Ä–µ–º–µ–Ω—Ç–∞–ª—å–Ω–∞—è .

2.body:
–ü—Ä–∏ –ø–æ—è–≤–ª–µ–Ω–∏–∏ –±–æ–ª—å—à–æ–≥–æ –∫–æ–ª-–≤–∞ —Ç–µ—Å—Ç–æ–≤ –±—É–¥–µ—Ç –ø–æ–ª–µ–∑–Ω—ã–º –æ—Ä–≥–∞–Ω–∏–∑–æ–≤–∞—Ç—å –∏—Ö –≤ –≥—Ä—É–ø–ø—É. –ì—Ä—É–ø–ø–∞ —Ç–µ—Å—Ç–æ–≤ –º–æ–∂–µ—Ç –±—ã—Ç—å —Å–æ–∑–¥–∞–Ω–∞ –æ–¥–Ω–∏–º –∏–∑ 2 —Å–ø–æ—Å–æ–±–æ–≤: –†–∞–∑–º–µ—Å—Ç–∏–≤ —Ñ—É–Ω–∫—Ü–∏–∏ –≤ —Ç–∏–ø –¥–∞–Ω–Ω—ã—Ö –†–∞–∑–º–µ—Å—Ç–∏–≤ –≤ —Ç–∏–ø –¥–∞–Ω–Ω—ã—Ö –∏ –ø—Ä–∏–º–µ–Ω–∏—Ç—å –∞—Ç—Ä–∏–±—É—Ç @Suite –¢–µ—Å—Ç—ã, –∫–æ—Ç–æ—Ä—ã–µ —Ç—ã —Ä–∞–Ω–µ–µ –≤—Å—Ç—Ä–µ—á–∞–ª, –±—ã–ª–∏ –≥–ª–æ–±–∞–ª—å–Ω—ã–º–∏, —Ç.–µ. –Ω–µ –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞–ª–∏ –∫ –∫–∞–∫–æ–º—É-–ª–∏–±–æ —Ç–∏–ø—É –¥–∞–Ω–Ω—ã—Ö. –î–ª—è –æ—Ä–≥–∞–Ω–∏–∑–∞—Ü–∏–∏ —Ç–µ—Å—Ç–æ–≤ –º–æ–∂–µ–º –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –ª—é–±–æ–π —Ç–∏–ø –¥–∞–Ω–Ω—ã—Ö —Å—É—â–µ—Å—Ç–≤—É—é—â–∏–π –≤ Swift, –Ω–∞–ø—Ä–∏–º–µ—Ä —Å—Ç—Ä—É–∫—Ç—É—Ä—É: struct UserProfileTest { @Test("‚ùå –ù–µ–ø—Ä–∞–≤–∏–ª—å–Ω–∞—è –ø—Ä–æ–≤–µ—Ä–∫–∞ –æ–ø—Ü–∏–æ–Ω–∞–ª—å–Ω–æ–≥–æ –≥–æ—Ä–æ–¥–∞") func userProfileHaveCity() async {} @Test("–ü—Ä–∞–≤–∏–ª—å–Ω–∞—è –ø—Ä–æ–≤–µ—Ä–∫–∞ –æ–ø—Ü–∏–æ–Ω–∞–ª—å–Ω–æ–≥–æ –≥–æ—Ä–æ–¥–∞") func userHaveCity() async throws {} // ... –¥—Ä—É–≥–∏–µ —Ç–µ—Å—Ç—ã
} –ù–∞–≤–∏–≥–∞—Ü–∏–æ–Ω–Ω–æ–µ –º–µ–Ω—é —Ç–µ—Å—Ç–æ–≤ –≤ Xcode (‚åò + 6) –∞–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–∏–π —Ä–∞—Å–ø–æ–∑–Ω–∞–µ—Ç –≥—Ä—É–ø–ø–∏—Ä–æ–≤–∫—É —Ç–µ—Å—Ç–æ–≤. –ü—Ä–∏–º–µ–Ω–µ–Ω–∏–µ –∞—Ç—Ä–∏–±—É—Ç–∞ @Suite —è–≤–ª—è–µ—Ç—Å—è –Ω–µ–æ–±—è–∑–∞—Ç–µ–ª—å–Ω—ã–º, –Ω–æ —Å –ø–æ–º–æ—â—å—é –∞—Ç—Ä–∏–±—É—Ç–∞ –º–æ–∂–Ω–æ –Ω–∞—Å—Ç—Ä–æ–∏—Ç—å –≤–Ω–µ—à–Ω–∏–π –≤–∏–¥ —Ç–µ—Å—Ç–æ–≤, –ø—Ä–∏–º–µ–Ω–∏—Ç—å —Ä–∞–∑–ª–∏—á–Ω—ã–µ —Ç—Ä–µ–π—Ç—ã[2] –∏ –¥—Ä—É–≥–æ–µ. –ü–æ–º–∏–º–æ —ç—Ç–æ–≥–æ, —Ç–∏–ø—ã –¥–∞–Ω–Ω—ã—Ö –º–æ–≥—É—Ç –±—ã—Ç—å –≤–ª–æ–∂–µ–Ω—ã –¥—Ä—É–≥ –≤ –¥—Ä—É–≥–∞: @Suite("–¢–µ—Å—Ç—ã —é–∑–µ—Ä –ø—Ä–æ—Ñ–∞–π–ª–∞")
struct UserProfileTest { @Test("‚ùå –ù–µ–ø—Ä–∞–≤–∏–ª—å–Ω–∞—è –ø—Ä–æ–≤–µ—Ä–∫–∞ –æ–ø—Ü–∏–æ–Ω–∞–ª—å–Ω–æ–≥–æ –≥–æ—Ä–æ–¥–∞") func userProfileHaveCity() async {} @Test("–ü—Ä–∞–≤–∏–ª—å–Ω–∞—è –ø—Ä–æ–≤–µ—Ä–∫–∞ –æ–ø—Ü–∏–æ–Ω–∞–ª—å–Ω–æ–≥–æ –≥–æ—Ä–æ–¥–∞") func userHaveCity() async throws {} @Suite("–¢–µ—Å—Ç–∏—Ä–æ–≤–∞–Ω–∏–µ –∞–≤–∞—Ç–∞—Ä–∫–∏") enum EmptyCitySearch { @Test("–í—ã–±–æ—Ä –∞–≤–∞—Ç–∞—Ä–∫–∏ –≤ –ø—Ä–æ—Ñ–∏–ª–µ") func selectProfileAvatar(by query: String) {} }
} –†–∞–Ω–Ω–µ–µ —è –Ω–µ —É–ø–æ–º–Ω—è–ª –æ –∫–æ–Ω—Ü–µ–ø—Ü–∏–∏ —Ç—Ä–µ–π—Ç–æ–≤ –¥–ª—è –º–∞–∫—Ä–æ—Å–æ–≤ @Test –∏ @Suite, –Ω–æ —á—É—Ç—å –ø–æ–∑–∂–µ —Ç—ã –ø–æ–∑–Ω–∞–∫–æ–º–∏—à—å—Å—è —Å —ç—Ç–∏–º –ø–æ–Ω—è—Ç–∏–µ–º.

