21.body:
–ù–µ–∑–∞–≤–∏—Å–∏–º—ã–π –º–∞–∫—Ä–æ—Å —É–∫–∞–∑—ã–≤–∞—é—â–∏–π –Ω–∞ –º–µ—Å—Ç–æ–ø–æ–ª–æ–∂–µ–Ω–∏–µ –≤ –∏—Å—Ö–æ–¥–Ω–æ–º –∫–æ–¥–µ. –°—Ü–µ–Ω–∞—Ä–∏–∏ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è –º–æ–≥—É—Ç –±—ã—Ç—å —Ä–∞–∑–Ω—ã–º–∏, –Ω–∞–ø—Ä–∏–º–µ—Ä –¥–ª—è —É–ª—É—á—à–µ–Ω–∏—è —á–∏—Ç–∞–µ–º–æ—Å—Ç–∏ —Å–æ–æ–±—â–µ–Ω–∏–π –æ–± –æ—à–∏–±–∫–∞—Ö –≤ —Ç–µ—Å—Ç–∞—Ö, —É–∫–∞–∑–∞–Ω–∏–∏ –Ω–∞ –∫–æ–Ω–∫—Ä–µ—Ç–Ω—ã–π –º–æ–¥—É–ª—å –∏–ª–∏ –∏–º—è –∏—Å—Ö–æ–¥–Ω–æ–≥–æ —Ñ–∞–π–ª–∞. –ò–Ω—Ñ–æ—Ä–º–∞—Ü–∏—è –æ –º–æ–¥—É–ª–µ, –∏–º–µ–Ω–∏ —Ñ–∞–π–ª–∞ –∏ –¥—Ä—É–≥–∏—Ö —Å–≤–æ–π—Å—Ç–≤–∞—Ö —Å–æ–±–∏—Ä–∞–µ—Ç—Å—è –Ω–∞ —ç—Ç–∞–ø–µ –∫–æ–º–ø–∏–ª—è—Ü–∏–∏. func getTestLocation(testName: String = #function) { let location = #_sourceLocation() print("–ó–∞–ø—É—â–µ–Ω —Ç–µ—Å—Ç \(testName) –≤ —Ñ–∞–π–ª–µ \(location.fileName)\n–ú–æ–¥—É–ª—å: \(location.moduleName)")
} @Test
func followTheWhiteRabbit() { getTestLocation() let movie = Movie(name: "The Matrix") #expect(movie.mainCharacter == "Keanu Beeves")
} ‚óá Test followTheWhiteRabbit() started. –ó–∞–ø—É—â–µ–Ω —Ç–µ—Å—Ç followTheWhiteRabbit() –≤ —Ñ–∞–π–ª–µ IssueExample.swift –ú–æ–¥—É–ª—å: ModernAppTests ‚ùå Expectation failed: "Keanu Beeves" == "Keanu Reeves"

22.body:
–ó–∞ —Ä–µ–∞–ª–∏–∑–∞—Ü–∏—é –º–∞–∫—Ä–æ—Å –æ—Ç–≤–µ—á–∞–µ—Ç —Ç–∏–ø –¥–∞–Ω–Ω—ã—Ö SourceLocation. –ù–∏–∂–µ —è –ø–µ—Ä–µ—á–∏—Å–ª–∏–ª –≤—Å–µ –¥–æ—Å—Ç—É–ø–Ω—ã–µ —Å–≤–æ–π—Å—Ç–≤–∞ –Ω–∞ –º–æ–º–µ–Ω—Ç –≤—ã—Ö–æ–¥–∞ –∫–Ω–∏–≥–∏: struct SourceLocation: Sendable { var fileID: String {...} var fileName: String {...} var moduleName: String {...} var line: Int {...} var column: Int {...}
} fileID —É–Ω–∏–∫–∞–ª—å–Ω—ã–π –∏–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä –∏—Å—Ö–æ–¥–Ω–æ–≥–æ —Ñ–∞–π–ª–∞. fileName –∏–º—è –∏—Å—Ö–æ–¥–Ω–æ–≥–æ —Ñ–∞–π–ª–∞. moduleName –∏–º—è –º–æ–¥—É–ª—è, –≤ –∫–æ—Ç–æ—Ä–æ–º –Ω–∞—Ö–æ–¥–∏—Ç—Å—è –¥–∞–Ω–Ω—ã–π –∏—Å—Ö–æ–¥–Ω—ã–π —Ñ–∞–π–ª. line —Å—Ç—Ä–æ–∫–∞ –ø–æ —Å—á–µ—Ç—É –≤ –∏—Å—Ö–æ–¥–Ω–æ–º —Ñ–∞–π–ª–µ. column —Å—Ç–æ–ª–±–µ—Ü –ø–æ —Å—á–µ—Ç—É –≤ –∏—Å—Ö–æ–¥–Ω–æ–º —Ñ–∞–π–ª–µ. note SourceLocation –∏—Å–ø–æ–ª—å–∑—É–µ—Ç—Å—è –≤ —Ä–µ–∞–ª–∏–∑–∞—Ü–∏–∏ –º–∞–∫—Ä–æ—Å–∞ @Test –∏ –¥—Ä—É–≥–∏—Ö —Ç—Ä–µ–π—Ç–∞—Ö. –ï—Å–ª–∏ –∏–Ω—Ç–µ—Ä–µ—Å–Ω–æ, –ø–æ—á–µ–º—É –≤ –∏–º–µ–Ω–∏ –º–∞–∫—Ä–æ—Å–∞ –ø—Ä–∏—Å—É—Ç—Å—Ç–≤—É–µ—Ç –Ω–∏–∂–Ω–µ–µ –ø–æ–¥—á–µ—Ä–∫–∏–≤–∞–Ω–∏–µ, —Ç–æ –≤–∑–≥–ª—è–Ω–∏ –Ω–∞ –æ–±—ä—è–≤–ª–µ–Ω–∏–µ: @freestanding(expression)
public macro _sourceLocation() -> SourceLocation = #externalMacro(module: "TestingMacros", type: "SourceLocationMacro") –†–∞–Ω–µ–µ —Ç—ã –∏–∑—É—á–∏–ª –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –æ –∞—Ç—Ä–∏–±—É—Ç–µ @freestanding(...) –∏ –∑–Ω–∞–µ—à—å, —á—Ç–æ —ç—Ç–æ –æ–±–æ–∑–Ω–∞—á–∞–µ—Ç. –ï—Å–ª–∏ —ç—Ç–æ –Ω–µ —Ç–∞–∫, –Ω–∏—á–µ–≥–æ —Å—Ç—Ä–∞—à–Ω–æ–≥–æ, –ø—Ä–æ—Å—Ç–æ –≤–µ—Ä–Ω–∏—Å—å –Ω–∞–∑–∞–¥ –∏ –æ—Å–≤–µ–∂–∏ –∑–Ω–∞–Ω–∏—è . –î–æ—Å—Ç—É–ø –∫ –º–∞–∫—Ä–æ—Å—É —Ä–∞–∑–≤—è–∑—ã–≤–∞–µ—Ç –ø–∞–ª—å—Ü—ã –∏ —Ç—ã –º–æ–∂–µ—à—å —Å–¥–µ–ª–∞—Ç—å –∏–Ω—Ç–µ–≥—Ä–∞—Ü–∏—é —Å –∫–∞–∫–∏–º-–ª–∏–±–æ –º–µ—Å—Å–µ–Ω–¥–∂–µ—Ä–æ–º. –í–º–µ—Å—Ç–æ –≤—ã–∑–æ–≤–∞ —Ñ—É–Ω–∫—Ü–∏–∏ print() –º–æ–∂–Ω–æ –±—É–¥–µ—Ç –æ—Ç–ø—Ä–∞–≤–ª—è—Ç—å –∑–∞–ø—Ä–æ—Å—ã –≤ –≥—Ä—É–ø–ø—É —Ç–µ–ª–µ–≥—Ä–∞–º–∞ –∏ –≤–∏–¥–µ—Ç—å —Ö–æ–¥ –≤—ã–ø–æ–ª–Ω–µ–Ω–∏—è —Ç–µ—Å—Ç–æ–≤. –î—Ä—É–≥–æ–π –≤–æ–ø—Ä–æ—Å, –Ω–∞—Å–∫–æ–ª—å–∫–æ —ç—Ç–æ —Ü–µ–ª–µ—Å–æ–æ–±—Ä–∞–∑–Ω–æ ‚Äî —Ä–µ—à–∞–π —Å–∞–º.

23.body:
–í –ø–µ—Ä–µ–≤–æ–¥–µ –Ω–∞ —Ä—É—Å—Å–∫–∏–π, trait ‚Äî —ç—Ç–æ –¢–∏–ø–∞–∂ , –Ω–æ –≤ –∫–Ω–∏–≥–µ —è —á–∞—â–µ —É–ø–æ—Ç—Ä–µ–±–ª—è—é –ø—Ä–æ—Å—Ç–æ–π –≤–∞—Ä–∏–∞–Ω—Ç ‚Äî –¢—Ä–µ–π—Ç . –ü–µ—Ä–µ–¥ —Ç–µ–º, –∫–∞–∫ —è —Ä–∞—Å—Å–∫–∞–∂—É –¥–ª—è —á–µ–≥–æ –æ–Ω –Ω—É–∂–µ–Ω, –ø–æ–ø—Ä–æ–±—É–µ–º –ø–µ—Ä–µ–º–µ—Å—Ç–∏—Ç—å—Å—è –≤ —è–∑—ã–∫ –ø—Ä–æ–≥—Ä–∞–º–º–∏—Ä–æ–≤–∞–Ω–∏—è Rust, –∫–æ—Ç–æ—Ä—ã–π —Å–æ–¥–µ—Ä–∂–∏—Ç –∫–ª—é—á–µ–≤–æ–µ —Å–ª–æ–≤–æ trait. Trait –Ω–µ–æ–±—Ö–æ–¥–∏–º –¥–ª—è –æ–±—ä—è–≤–ª–µ–Ω–∏—è –Ω–∞–±–æ—Ä–∞ –ø—Ä–∞–≤–∏–ª, –∫–æ—Ç–æ—Ä—ã–µ –±—É–¥—É—Ç —Ä–µ–∞–ª–∏–∑–æ–≤–∞–Ω—ã. –î–∞–Ω–Ω–∞—è –∫–æ–Ω—Ü–µ–ø—Ü–∏—è –æ—á–µ–Ω—å —Å—Ö–æ–∂–∞ —Å –∫–ª—é—á–µ–≤—ã–º —Å–ª–æ–≤–æ–º protocol –≤ swift. // –í–Ω—É—Ç—Ä–∏ –Ω–æ–≤–æ–π —Å–∏—Å—Ç–µ–º—ã —Ç–µ—Å—Ç–∏—Ä–æ–≤–∞–Ω–∏–π –Ω–∞—Ö–æ–¥–∏—Ç—Å—è –æ—Å–Ω–æ–≤–Ω–æ–π —Ç—Ä–µ–π—Ç
// –û–Ω –∂–µ swift-testing/Sources/Testing/Traits/Trait.swift
public protocol Trait : Sendable {...} –î–∞–Ω–Ω—ã–π –ø—Ä–æ—Ç–æ–∫–æ–ª –æ–ø–∏—Å—ã–≤–∞–µ—Ç, –∫–∞–∫–∏–µ —Ç—Ä–µ–π—Ç—ã –º–æ–≥—É—Ç –±—ã—Ç—å –¥–æ–±–∞–≤–ª–µ–Ω—ã –∫ –º–∞–∫—Ä–æ—Å–∞–º @Test –∏ @Suite. –ü–æ–º–∏–º–æ —ç—Ç–æ–≥–æ –ø—Ä–æ—Ç–æ–∫–æ–ª Trait —è–≤–ª—è–µ—Ç—Å—è –∫–æ—Ä–Ω–µ–≤—ã–º (–≥–ª–∞–≤–Ω—ã–º). –ë–∏–±–ª–∏–æ—Ç–µ–∫–∞ Swift Testing —Å–æ–¥–µ—Ä–∂–∏—Ç –≥–æ—Ç–æ–≤—ã–µ —Ç—Ä–µ–π—Ç—ã, —Å–æ–∑–¥–∞–Ω–Ω—ã–µ –∏–Ω–∂–µ–Ω–µ—Ä–∞–º–∏ Apple. –ü–æ–º–∏–º–æ —ç—Ç–æ–≥–æ, —Ç—ã —Å–∞–º –≤–ø—Ä–∞–≤–µ –¥–æ–±–∞–≤–∏—Ç—å —Å–æ–±—Å—Ç–≤–µ–Ω–Ω—ã–π —Ç—Ä–µ–π—Ç. –û —Å–æ–∑–¥–∞–Ω–∏–∏ —Å–æ–±—Å—Ç–≤–µ–Ω–Ω—ã—Ö —Ç—Ä–µ–π—Ç–æ–≤ —Å–∫–∞–∑–∞–Ω–æ –≤ —ç—Ç–æ–π –≥–ª–∞–≤–µ . note –¢—Ä–µ–π—Ç –≤ –Ω–æ–≤–æ–π —Å–∏—Å—Ç–µ–º–µ —Ç–µ—Å—Ç–∏—Ä–æ–≤–∞–Ω–∏—è ‚Äî –µ—Å—Ç—å –ø—Ä–æ—Ç–æ–∫–æ–ª, –ø–æ–¥–ø–∏—Å–∞–Ω–Ω—ã–π –Ω–∞ –æ—Å–Ω–æ–≤–Ω–æ–π –ø—Ä–æ—Ç–æ–∫–æ–ª Trait.

25.body:
–ö–∞–∂–¥—ã–π –º–∞–∫—Ä–æ—Å @Test –ø—Ä–∏–Ω–∏–º–∞–µ—Ç –Ω–æ–ª—å –∏ –±–æ–ª–µ–µ —Ç—Ä–µ–π—Ç–æ–≤. –≠—Ç–æ –≤–æ–∑–º–æ–∂–Ω–æ –±–ª–∞–≥–æ–¥–∞—Ä—è: —ç–∫–∑–µ—Å—Ç–µ–Ω—Ü–∏–∞–ª—å–Ω–æ–º—É any –≤–∞—Ä–∏–∞—Ç–∏–≤–Ω–æ–º—É (variadic) –ø–∞—Ä–∞–º–µ—Ç—Ä—É (3 —Ç–æ—á–∫–∏) ... –°–ø—Ä–∞–≤–∫–∞ –æ any –∏ –≤–∞—Ä–∏–∞—Ç–∏–≤–Ω–æ–º –ø–∞—Ä–∞–º–µ—Ç—Ä–µ –ö–ª—é—á–µ–≤—ã–º —Å–ª–æ–≤–æ–º any –æ–±–æ–∑–Ω–∞—á–∞—é—Ç –ª—é–±–æ–π —Ç–∏–ø –¥–∞–Ω–Ω—ã—Ö, —Ä–µ–∞–ª–∏–∑—É—é—â–∏–π –ø—Ä–æ—Ç–æ–∫–æ–ª N. func showEachElement(for collection: any Collection) -> Void { collection.forEach { print($0) }
} let data: String = "Swift Testing"
let smallRange: ClosedRange = 0...5 showEachElement(for: data)
showEachElement(for: smallRange) –í–∞—Ä–∏–∞—Ç–∏–≤–Ω—ã–π –ø–∞—Ä–∞–º–µ—Ç—Ä ‚Äî —ç—Ç–æ –ø–∞—Ä–∞–º–µ—Ç—Ä, –∫–æ—Ç–æ—Ä—ã–π –ø—Ä–∏–Ω–∏–º–∞–µ—Ç 0 –∏–ª–∏ –º–Ω–æ–∂–µ—Å—Ç–≤–æ –∑–Ω–∞—á–µ–Ω–∏–π –∫–æ–Ω–∫—Ä–µ—Ç–Ω–æ–≥–æ —Ç–∏–ø–∞ –¥–∞–Ω–Ω—ã—Ö. –û–±–æ–∑–Ω–∞—á–∞–µ—Ç—Å—è —Å –ø–æ–º–æ—â—å—é 3 —Ç–æ—á–µ–∫ –ø–æ—Å–ª–µ —Ç–∏–ø–∞ –¥–∞–Ω–Ω—ã—Ö: func quickMath(numbers: Int...) -> String { let sum = numbers.reduce(.zero, +) let cosValue = cos(Double(sum)) let sinValue = sin(Double(sum)) return """ üéâ –î–æ–±—Ä–æ –ø–æ–∂–∞–ª–æ–≤–∞—Ç—å –Ω–∞ —Å–µ—Ä–≤–µ—Ä –¢—Ä–∏–≥–æ–Ω–æ–º–µ—Ç—Ä–∏–∏! üéâ –°—É–º–º–∞ —á–∏—Å–µ–ª: \(sum) –ö–æ—Å–∏–Ω—É—Å —á–∏—Å–ª–∞: \(sum) = \(cosValue) –°–∏–Ω—É—Å —á–∏—Å–ª–∞: \(sum) = \(sinValue) """ } // –ó–Ω–∞—á–µ–Ω–∏—è –ø–µ—Ä–µ—á–∏—Å–ª—è—é—Ç—Å—è —á–µ—Ä–µ–∑ –∑–∞–ø—è—Ç—É—é quickMath(numbers: 30, 60, 90)

