62.body:
Plan ‚Äî —Ç–∏–ø –¥–∞–Ω–Ω—ã—Ö –æ–ø–∏—Å—ã–≤–∞—é—â–∏–π –ø–ª–∞–Ω –¥–ª—è Runner, –∞ –∏–º–µ–Ω–Ω–æ –∫–∞–∫–∏–µ —Ç–µ—Å—Ç—ã –±—É–¥—É—Ç –∑–∞–ø—É—â–µ–Ω—ã, –≤ –∫–∞–∫–æ–º –ø–æ—Ä—è–¥–∫–µ –∏ —Å –∫–∞–∫–∏–º –¥–µ–π—Å—Ç–≤–∏–µ–º (Action): extension Runner { public struct Plan: Sendable { public enum Action: Sendable { public struct RunOptions: Sendable, Codable { // ... } // ... } // ... public struct Step: Sendable { public var test: Test public var action: Action } }
} –°—Ç—Ä—É–∫—Ç—É—Ä–∞ Plan –ø—Ä–µ–¥—Å—Ç–∞–≤–ª—è–µ—Ç —Å–æ–±–æ–π: Step: –ø—Ä–µ–¥—Å—Ç–∞–≤–ª—è–µ—Ç —Å–æ–±–æ–π —à–∞–≥ –≤ —Ö–æ–¥–µ –≤—ã–ø–æ–ª–Ω–µ–Ω–∏—è. –ö–∞–∂–¥—ã–π —à–∞–≥ —Å–æ—Å—Ç–æ–∏—Ç –∏–∑ —Å–∞–º–æ–≥–æ —Ç–µ—Å—Ç–∞, –∫–æ—Ç–æ—Ä—ã–π –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å –≤—ã–ø–æ–ª–Ω–µ–Ω –∏ –¥–µ–π—Å—Ç–≤–∏—è, –∫–æ—Ç–æ—Ä–æ–µ –¥–æ–ª–∂–Ω–æ –±—ã—Ç—å –≤—ã–ø–æ–ª–Ω–µ–Ω–æ –¥–ª—è —ç—Ç–æ–≥–æ —Ç–µ—Å—Ç–∞. Graph: —Å–æ–∑–¥–∞–µ—Ç –∏–µ—Ä–∞—Ä—Ö–∏—é —à–∞–≥–æ–≤ (Step) –î—Ä—É–≥–∏–µ –≤—Å–ø–æ–º–æ–≥–∞—Ç–µ–ª—å–Ω—ã–µ –º–µ—Ç–æ–¥—ã, –Ω–∞–ø—Ä–∏–º–µ—Ä: –º–µ—Ç–æ–¥ –æ—Ç–≤–µ—á–∞—é—â–∏–π –∑–∞ —Ä–µ–∫—É—Ä—Å–∏–≤–Ω–æ–µ –ø—Ä–∏–º–µ–Ω–µ–Ω–∏–µ –¥–µ–π—Å—Ç–≤–∏–π (Action). –¢–∏–ø –¥–∞–Ω–Ω—ã—Ö Plan —Å—Ç—Ä—É–∫—Ç—É—Ä–∏—Ä—É–µ—Ç —Ç–µ—Å—Ç—ã –≤ –≤–∏–¥–µ –≥—Ä–∞—Ñ–∞: var stepGraph: Graph<String, Step?> public var steps: [Step] { stepGraph .compactMap(\.value) .sorted { $0.test.sourceLocation < $1.test.sourceLocation }
} –ò –∫–∞–∫ —è —Ä–∞–Ω–µ–µ —Å–∫–∞–∑–∞–ª, –≤ –∫–∞–∂–¥–æ–º –ø–ª–∞–Ω–µ –µ—Å—Ç—å –¥–µ–π—Å—Ç–≤–∏–µ, –∫–æ—Ç–æ—Ä–æ–µ —Ç—Ä–µ–±—É–µ—Ç—Å—è —Å–¥–µ–ª–∞—Ç—å —Å —Ç–µ—Å—Ç–æ–º: enum Action: Sendable { case run(options: RunOptions) indirect case skip(_ skipInfo: SkipInfo) indirect case recordIssue(_ issue: Issue)
} Run: —Ç–µ—Å—Ç –±—É–¥–µ—Ç –≤—ã–ø–æ–ª–Ω–µ–Ω. Skip: —Ç–µ—Å—Ç –±—É–¥–µ—Ç –ø—Ä–æ–ø—É—â–µ–Ω –ø–æ –ø—Ä–∏—á–∏–Ω–µ SkipInfo. RecordIssue: –∑–∞–ø–∏—Å—å –ø—Ä–æ–±–ª–µ–º—ã –ø–æ –∫–æ—Ç–æ—Ä–æ–π —Ç–µ—Å—Ç –Ω–µ –±—ã–ª –≤—ã–ø–æ–ª–Ω–µ–Ω.

64.body:
–ù–∞–∫–æ–Ω–µ—Ü-—Ç–æ —Ç—ã –¥–æ–±—Ä–∞–ª—Å—è –¥–æ —Å–µ–∫—Ü–∏–∏ –∑–∞–ø—É—Å–∫–∞. –ö–∞–∫ —Ç—ã –∑–Ω–∞–µ—à—å, –≤ –ª—é–±—ã—Ö —è–∑—ã–∫ –ø—Ä–æ–≥—Ä–∞–º–º–∏—Ä–æ–≤–∞–Ω–∏—è —Å—É—â–µ—Å—Ç–≤—É–µ—Ç EntryPoint. –ó–∞–ø—É—Å–∫ –ª—é–±–æ–π –ø—Ä–æ–≥—Ä–∞–º–º—ã –Ω–∞—á–∏–Ω–∞–µ—Ç—Å—è —Å —Ç–æ—á–∫–∏ –≤—Ö–æ–¥–∞. –≠—Ç–æ –∫–∞—Å–∞–µ—Ç—Å—è –∏ Swift Testing, –ø–æ—Å–∫–æ–ª—å–∫—É —ç—Ç–æ —Ç–æ–∂–µ –ø—Ä–æ–≥—Ä–∞–º–º–∞. –¢–æ—á–∫–∞ –≤—Ö–æ–¥–∞ (EntryPoint) ‚Äî –∞–¥—Ä–µ—Å –≤ –æ–ø–µ—Ä–∞—Ç–∏–≤–Ω–æ–π –ø–∞–º—è—Ç–∏, —Å –∫–æ—Ç–æ—Ä–æ–≥–æ –Ω–∞—á–∏–Ω–∞–µ—Ç—Å—è –≤—ã–ø–æ–ª–Ω–µ–Ω–∏–µ –ø—Ä–æ–≥—Ä–∞–º–º—ã. –ü–æ—Å–ª–µ —Ç–æ–≥–æ, –∫–∞–∫ —Ç—ã –Ω–∞–ø–∏—Å–∞–ª —Å–≤–æ–π –ø–µ—Ä–≤—ã–π —Ç–µ—Å—Ç –∏ –∑–∞–ø—É—Å—Ç–∏–ª –µ–≥–æ, –ø—Ä–æ–∏—Å—Ö–æ–¥–∏—Ç —Å–ª–µ–¥—É—é—â–µ–µ: –°–æ–∑–¥–∞–µ—Ç—Å—è –∫–æ–Ω—Ñ–∏–≥—É—Ä–∞—Ü–∏—è –ø–æ —É–º–æ–ª—á–∞–Ω–∏—é –≤ –º–µ—Ç–æ–¥–µ configurationForEntryPoint(from:) –ó–∞–ø—É—Å–∫–∞–µ—Ç—Å—è Runner —Å —É–∫–∞–∑–∞–Ω–Ω–æ–π –∫–æ–Ω—Ñ–∏–≥—É—Ä–∞—Ü–∏–µ–π –ó–Ω–∞—á–µ–Ω–∏–µ runner.tests –ø—Ä–∏—Å–≤–∞–µ—Ç—Å—è –∫–æ–Ω—Å—Ç–∞–Ω—Ç–µ tests –ü—Ä–æ–∏—Å—Ö–æ–¥–∏—Ç –∑–∞–ø—É—Å–∫ —Ç–µ—Å—Ç–æ–≤ —Å –ø–æ–º–æ—â—å—é –º–µ—Ç–æ–¥–∞ await runner.run() public func configurationForEntryPoint(from args: __CommandLineArguments_v0) throws -> Configuration { var configuration = Configuration() configuration.isParallelizationEnabled = args.parallel ?? true // ...
} func entryPoint(passing args: __CommandLineArguments_v0?, eventHandler: Event.Handler?) async -> CInt { // ... let tests: [Test] var configuration = try configurationForEntryPoint(from: args) let runner = await Runner(configuration: configuration) tests = runner.tests await runner.run()
} public func __swiftPMEntryPoint(passing args: __CommandLineArguments_v0? = nil) async -> CInt { #if !SWT_NO_FILE_IO // Ensure that stdout is line- rather than block-buffered. Swift Package // Manager reroutes standard I/O through pipes, so we tend to end up with // block-buffered streams. FileHandle.stdout.withUnsafeCFILEHandle { stdout in _ = setvbuf(stdout, nil, _IOLBF, Int(BUFSIZ)) } #endif return await entryPoint(passing: args, eventHandler: nil)
} await Testing.__swiftPMEntryPoint() as Never –ö–æ–Ω–µ—á–Ω–æ, –Ω–∞ –¥–µ–ª–µ –∑–∞–ø—É—Å–∫ —Ç–µ—Å—Ç–æ–≤ –Ω–µ —Ç–∞–∫–æ–π –ø—Ä–æ—Å—Ç–æ–π, –∫–∞–∫ —è –æ–ø–∏—Å–∞–ª. –ü–æ–º–∏–º–æ —ç—Ç–æ–≥–æ –ø—Ä–æ–∏—Å—Ö–æ–¥—è—Ç —Ä–∞–∑–ª–∏—á–Ω—ã–µ –ø—Ä–æ–≤–µ—Ä–∫–∏ –∏ –≥–ª–∞–≤–∞ –æ –∑–∞–ø—É—Å–∫–µ –ø—Ä–µ–≤—Ä–∞—Ç–∏—Ç—Å—è –≤ –≥–ª–∞–≤—É –æ –ø—Ä–æ–≤–µ—Ä–∫–∞—Ö –ø–µ—Ä–µ–¥ –∑–∞–ø—É—Å–∫–æ–º. –ò–º–µ–Ω–Ω–æ –ø–æ—ç—Ç–æ–º—É —è –Ω–∞–º–µ—Ä–µ–Ω–Ω–æ —É–ø—Ä–æ—Å—Ç–∏–ª –æ–±—ä—è—Å–Ω–µ–Ω–∏–µ –∑–∞–ø—É—Å–∫–∞ —Ç–µ—Å—Ç–æ–≤ —Å –ø–æ–º–æ—â—å—é EntryPoint. note –ï—Å–ª–∏ –µ—Å—Ç—å –∂–µ–ª–∞–Ω–∏–µ –æ–∑–Ω–∞–∫–æ–º–∏—Ç—Å—è –±–æ–ª–µ–µ –ø–æ–¥—Ä–æ–±–Ω–æ, —Ç—ã –≤—Å–µ–≥–¥–∞ –º–æ–∂–µ—à—å –ø—Ä–æ—á–∏—Ç–∞—Ç—å –∏—Å—Ö–æ–¥–Ω—ã–π –∫–æ–¥ Swift Testing. –° –ø–µ—Ä–≤—ã–º —à–∞–≥–æ–º —Å–ø—Ä–∞–≤–∏–ª–∏—Å—å –∏ —Ç–µ—Å—Ç—ã –∑–∞–ø—É—â–µ–Ω—ã, –Ω–æ –≤–æ–∑–Ω–∏–∫–∞–µ—Ç —Å–ª–µ–¥—É—é—â–∏–π –≤–æ–ø—Ä–æ—Å: ¬´–ö–∞–∫ –∑–∞–≤–µ—Ä—à–∏—Ç—å —Ç–µ—Å—Ç —É–ø–µ—Ö–æ–º –∏–ª–∏ –Ω–µ—É–¥–∞—á–µ–π¬ª?

