9.body:
–ü–µ—Ä–µ–¥ –ø—Ä–æ—á—Ç–µ–Ω–∏–µ–º —Ç–æ–Ω–∫–æ—Å—Ç–µ–π, —è –±—ã —Ö–æ—Ç–µ–ª –ø–æ–∫–∞–∑–∞—Ç—å –ø–æ—Å–ª–µ–¥–Ω–∏–π –ø—Ä–æ—Ü–µ—Å—Å —Å–≤—è–∑–∞–Ω–Ω—ã–π —Å –ø–æ–≤—Ç–æ—Ä–µ–Ω–∏–µ–º —Ç–µ—Å—Ç–æ–≤, –∞ –∏–º–µ–Ω–Ω–æ –∞—Ä–≥—É–º–µ–Ω—Ç–∞–º–∏. –ü—Ä–µ–¥–ø–æ–ª–æ–∂–∏–º, —á—Ç–æ —É —Ç–µ–±—è –µ—Å—Ç—å —Å–µ—Ä–≤–∏—Å –ø–æ –¥–æ—Å—Ç–æ–ø—Ä–∏–º–µ—á–∞—Ç–µ–ª—å–Ω–æ—Å—Ç—è–º –∏ —Ç—ã —Ö–æ—á–µ—à—å —É–∑–Ω–∞—Ç—å –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –æ –∫–∞–∂–¥–æ–º –∏–∑ –Ω–∏—Ö: struct PlaceService { func search(by name: String) async -> Bool { let places: [String] = [ "Gullfoss", "Saint Victor", "Vestmannaeyjar", "Skogafoss", "Hong Kong" ] return places.contains(name) }
} @Test
func findPlace() async throws { let places: [String] = [ "Gullfoss", "Moscow", "Vestmannaeyjar", "Skogafoss", "Paris", "Borocay", "Hong Kong" ] let service = PlaceService() for place in places { let result = await service.search(by: place) #expect(result) }
} –û—à–∏–±–∫–∞ –≤ —Ç–µ—Å—Ç–µ, –Ω–æ –≥–¥–µ? –¢–µ—Å—Ç –≤—ã—à–µ —Ä–∞–±–æ—Ç–∞–µ—Ç, –æ–¥–Ω–∞–∫–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ —Ü–∏–∫–ª–∞ for –∏–º–µ–µ—Ç —Å–≤–æ–∏ –Ω–µ–¥–æ—Å—Ç–∞—Ç–∫–∏: –¢—ã –Ω–µ –º–æ–∂–µ—à—å –≤–∏–¥–µ—Ç—å —Ä–µ–∑—É–ª—å—Ç–∞—Ç –∫–∞–∂–¥–æ–≥–æ –≤—ã–∑–æ–≤–∞ #expect(‚Ä¶) –≤ –Ω–∞–≤–∏–≥–∞—Ü–∏–æ–Ω–Ω–æ–º –º–µ–Ω—é —Ç–µ—Å—Ç–æ–≤. –¢—ã –Ω–µ –º–æ–∂–µ—à—å –ø–æ–≤—Ç–æ—Ä–Ω–æ –∑–∞–ø—É—Å—Ç–∏—Ç—å –æ—Ç–¥–µ–ª—å–Ω—ã–π —Ç–µ—Å—Ç –¥–ª—è –æ–¥–Ω–æ–≥–æ —ç–ª–µ–º–µ–Ω—Ç–∞ –º–∞—Å—Å–∏–≤–∞. –¢–µ—Å—Ç—ã –≤—ã–ø–æ–ª–Ω—è—é—Ç—Å—è –ø–æ—Å–ª–µ–¥–æ–≤–∞—Ç–µ–ª—å–Ω–æ. –ò—Å–ø—Ä–∞–≤–∏–º —Å–∏—Ç—É–∞—Ü–∏—é –∏ –ø–µ—Ä–µ–¥–∞–¥–∏–º –º–∞—Å—Å–∏–≤ –≤ –∫–∞—á–µ—Å—Ç–≤–µ –ø–∞—Ä–∞–º–µ—Ç—Ä–∞ arguments: @Test( arguments: [ "Gullfoss", "Moscow", "Vestmannaeyjar", "Skogafoss", "Paris", "Borocay", "Hong Kong" ]
